import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common'; // Import CommonModule
import { ProductService } from '../services/product.service';
import { Product } from '../models/product.model';

@Component({
  selector: 'app-product-list',
  templateUrl: './product-list.component.html',
  styleUrls: ['./product-list.component.css'],
})
export class ProductListComponent implements OnInit {
  products: Product[] = [];
  filterText: string = '';
  sortedProducts: Product[] = [];
  sortKey: string = 'name'; // Default sort key (name or price)
  sortDirection: string = 'asc'; // Default sort direction (asc or desc)


  constructor(private productService: ProductService) {}

  ngOnInit(): void {
    this.getProducts();


    addEventListener('keydown', (event: KeyboardEvent) => {
      if (event.key === 'Delete' || event.key === 'Backspace') {
        this.applyFilter()
      }
    });
  }
  getProducts(): void {
    this.productService.getAllProducts().subscribe(
      (products: any) => {
        this.products = products["data"];
        this.sortProducts();
      },
      (error) => {
        console.error('Error fetching products:', error);
      }
    );
  }
  // Function to sort the products based on the current sortKey and sortDirection
  sortProducts(): void {
    this.sortedProducts = [...this.products]; // Copy the products array to maintain the original data

    this.sortedProducts.sort((a: Product, b: Product) => {
      const aValue = a[this.sortKey];
      const bValue = b[this.sortKey];

      if (this.sortDirection === 'asc') {
        return aValue.localeCompare(bValue, 'en', { sensitivity: 'base' });
      } else {
        return bValue.localeCompare(aValue, 'en', { sensitivity: 'base' });
      }
    });
  }

  // Function to toggle the sort direction (asc or desc)
  toggleSortDirection(): void {
    this.sortDirection = this.sortDirection === 'asc' ? 'desc' : 'asc';
    this.sortProducts();
  }

  // Function to change the sort key (name or price)
  changeSortKey(key: string): void {
    this.sortKey = key;
    this.sortProducts();
  }

  applyFilter(): void {
  	this.getProducts();
    this.products = this.products.filter((product) =>
      product.name.toLowerCase().includes(this.filterText.toLowerCase())
    );
    console.log(this.products.length)
  }

  resetFilter(): void {
     this.getProducts();
  }
}
<h1>Product List</h1>

<!-- Filter Input -->
<div class="filter-container">
  <input
    type="text"
    [(ngModel)]="filterText"
    (keyup)="applyFilter()"
    placeholder="Filter by name"
  />
  <button (click)="resetFilter()">Clear</button>
</div>
<div>
  <button (click)="changeSortKey('name')">Sort by Name</button>
  <button (click)="changeSortKey('price')">Sort by Price</button>
  <button (click)="toggleSortDirection()">Toggle Sort Order ({{ sortDirection }})</button>
</div>
<!-- Product List -->
<ul class="product-list">
  <li *ngFor="let product of products" class="product-item">
    <h3 class="product-name">{{ product.name }}</h3>
    <p class="product-description">Description: {{ product.description }}</p>
    <p class="product-price">Price: {{ product.price | currency }}</p>
  </li>
</ul>
